import logo from "./assets/investment-calculator-logo.png";
import CalculateForm from "./assets/Components/Calculate/CalculateForm/CalculateForm";
import CalculateTable from "./assets/Components/Calculate/CalculateTable/CalculateTable";

function App() {
  return (
    <div>
      <header className="header">
        <img src={logo} alt="logo" />
        <h1>Investment Calculator</h1>
      </header>

      <CalculateForm />
      <CalculateTable />
    </div>
  );
}

export default App;
